import React from 'react';
import '../styles/Footer.css';

const Footer = () => {
  // Function to create floating particles in the footer
  const createParticles = () => {
    const particles = [];
    const particleCount = 8;
    
    for (let i = 0; i < particleCount; i++) {
      const size = Math.floor(Math.random() * 40) + 10;
      const left = Math.floor(Math.random() * 100);
      const delay = Math.floor(Math.random() * 5);
      const duration = Math.floor(Math.random() * 10) + 10;
      
      const style = {
        width: `${size}px`,
        height: `${size}px`,
        left: `${left}%`,
        bottom: `-${size}px`,
        animationDelay: `${delay}s`,
        animationDuration: `${duration}s`
      };
      
      particles.push(<div key={i} className="footer-particle" style={style}></div>);
    }
    
    return particles;
  };

  return (
    <footer className="footer">
      <div className="footer-particles">
        {createParticles()}
      </div>
      
      <div className="footer-container">
        <div className="footer-section brand-section">
          <img src="/logo-white.png" alt="Swiss Chalets Logo" className="footer-logo" />
          <h3 className="footer-tagline">Swiss Chalets AI solution of great distinction</h3>
          <div className="social-icons">
            <a href="https://facebook.com" aria-label="Facebook">
              <i className="fa-brands fa-facebook"></i>
            </a>
            <a href="https://twitter.com" aria-label="Twitter">
              <i className="fa-brands fa-twitter"></i>
            </a>
            <a href="https://instagram.com" aria-label="Instagram">
              <i className="fa-brands fa-instagram"></i>
            </a>
            <a href="https://linkedin.com" aria-label="LinkedIn">
              <i className="fa-brands fa-linkedin"></i>
            </a>
          </div>
        </div>

        <div className="footer-section office-section">
          <h3 className="footer-heading">Office</h3>
          <p className="footer-address">
            Place Numa-Droz,<br />
            Neuchâtel, 2000, CH
          </p>
          <a href="mailto:contact@swisschalets.com" className="footer-email">contact@swisschalets.com</a>
        </div>

        <div className="footer-section links-section">
          <h3 className="footer-heading">Links</h3>
          <ul className="footer-nav">
            <li><a href="/">HOME</a></li>
            <li><a href="/listings">SOLUTION</a></li>
            <li><a href="/about">ABOUT</a></li>
            <li><a href="/contact">CONTACT</a></li>
          </ul>
        </div>

        <div className="footer-section newsletter-section">
          <h3 className="footer-heading">Newsletter</h3>
          <form action="Newsletter.php" method="post">
            <i className="fa-regular fa-envelope"></i>
            <div className="input-container">
              <input type="email" name="news-email" placeholder="Enter your email" required />
            </div>
            <button type="submit" aria-label="Subscribe">
              <i className="fa-regular fa-paper-plane"></i>
            </button> 
          </form>
        </div>
      </div>
      
      <div className="footer-bottom">
        <p>&copy; {new Date().getFullYear()} Swiss Chalets. All rights reserved.</p>
      </div>
    </footer>
  );
};

export default Footer;
